function Card(props) {
  return (
    <div>
      <div className="blogBoxes">
        <div className="box">
          <img src={props.image} height="300px" width="290px" />
          <h6 className="blog-dates">{props.date}</h6>
          <h4 className="blog-headings">{props.bHeading}</h4>
          <button className="blog-btn">Read more</button>
        </div>
      </div>
    </div>
  );
}
function App() {
  <div>
    <Card
      image={<img src="./img-react/dog-1.jpeg" />}
      date="24 jan 2024"
      bHeading={
        <div>
          Finding your perfect <br /> dog breed
        </div>
      }
    />
    <Card
      image={<img src="./img-react/dog-1.jpeg" />}
      date="24 jan 2024"
      bHeading={
        <div>
          Finding your perfect <br /> dog breed
        </div>
      }
    />
    <Card
      image={<img src="./img-react/dog-1.jpeg" />}
      date="24 jan 2024"
      bHeading={
        <div>
          Finding your perfect <br /> dog breed
        </div>
      }
    />
  </div>;
}

export default App;
